import React from 'react'
import Navbar from '../component/Navbar';
import Topbar from '../component/Topbar';

function User() {
  return (
    <div className='new'>
        <Navbar/>
        <div className='newContainer'>
            <Topbar/>
            <div className='top'>
                <h1>Profile Pengguna</h1>
            </div>
        </div>
    </div>
  )
}

export default User;
